import React from "react";
import Card from "./Card"


function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <body>
      <Card 
      name = "Beyonce"
      pic = "https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
      email = "+123 456 789"
      phone = "b@beyonce.com"
      />
      </body>
    </div>
  );
}

export default App;
